    false,nt"url": null,nt"notes": "There are three tasks associated with this
    delivery order: Task 1: Elevations of the Low Steel for bridge superstructures on
    the following rivers: St. Croix between river miles 0 - 24 (05 bridges) Mississippi
    between river miles 634 - 858 (39 bridges) Minnesota between river miles 1 - 15
    (05 bridges) Black between river miles 1 - 2 (01 bridges) Total =50 Task 2: Elevations
    of the Lowest Sag Point of Overhead cables and extents/locations of supporting pylons
    on the following rivers: St. Croix between river miles 8 - 22 (04 O/H Cables) Mississippi
    between river miles 678 - 858 (26 O/H Cables) Minnesota between river miles 0 -
    15 (09 O/H Cables) Black between river miles 0 - 1 (01 O/H Cables) Total = 40 Task
    3: Collection of Navigation features and RAW Point Cloud of specified Lock and Dams
    on the following river: Mississippi between river miles 615 - 854 (13 Lock & Dams)
    The navigation features to be collected are Lock Guidewall, Lock Chamber and Lock
    Gates. Additionally, the RAW point cloud shall be collected for all accessible areas
    of the specified Lock and Dams. The total number of structures is 103. See attachment
    A for a detailed list of structures.",nt"license_title": null,nt"extras":
